import React, { Component } from 'react';

export const Dropdown = () => {
  return (
    <div className="h-64">
      <form action="" className="flex content-between">
        <select className="">
          <option>LUKE SKYWALKER</option>
        </select>
        <select className="">
          <option>PRINCESS LEIA</option>
        </select>
      </form>
    </div>
  );
};
